define({"topics":[{"title":"May 2022: AWS and Azure Linux OS Versions End of Support ","shortdesc":"<p class=\"shortdesc\">Amazon Web Services and Azure cloud providers have         announced that they will no longer support Ubuntu16 and Centos7 Linux servers that are         reaching the end of support by their providers.<\/p>","href":"content\/topics\/adv_tn_20211025_linux.html","attributes":{"data-id":"prod_tn_20211025_linux"},"menu":{"hasChildren":false},"tocID":"prod_tn_20211025_linux-d8884e14557","topics":[]},{"title":"May 2022: T-Mobile IPv4 settings – Required Cellular Firmware Update for 110g ","shortdesc":"<p class=\"shortdesc\">Quectel released guidance indicating T-Mobile IPv4 settings needed to be updated.         This cellular firmware update applies the required changes per Quectel guidance. <\/p>","href":"content\/topics\/adv_tn_202205_tmob_IPv4_fix.html","attributes":{"data-id":"adv_tn_202205_tmob_IPv4_fix"},"menu":{"hasChildren":false},"tocID":"adv_tn_202205_tmob_IPv4_fix-d8884e14568","topics":[]},{"title":"May 2022: AT&amp;T and T-Mobile 3G Sunset – Required Cellular Firmware Update for 110g ","shortdesc":"<p class=\"shortdesc\">AT&amp;T Turned off their 3G network on Feb 22, 2022, and T-Mobile is turning off         their 3G network on Jul 1, 2022. This change affects the Quectel modems on the 110g <span class=\"ph\">Airwall Gateway<\/span>, and any         AV3200g\/u <span class=\"ph\">Airwall Gateways<\/span>         installed before Dec 12, 2021. If you are operating one of these <span class=\"ph\">Airwall Gateways<\/span> using an         AT&amp;T or TMobile cellular connection, you should install new cellular firmware on them         before the respective shutoff date.<\/p>","href":"content\/topics\/adv_tn_202205_tmob_3g_sunset.html","attributes":{"data-id":"adv_tn_202205_tmob_3g_sunset"},"menu":{"hasChildren":false},"tocID":"adv_tn_202205_tmob_3g_sunset-d8884e14606","topics":[]},{"title":"Mar 2022: Auth0 Update does not affect OpenID Connect Integration","shortdesc":"<p class=\"shortdesc\">The Auth0 update deprecating fixed length authorization codes and access tokens         should have no effect on Auth0 authentication integration with an <span class=\"ph\">Airwall secure network<\/span>.<\/p>","href":"content\/topics\/202203A-001.html","attributes":{"data-id":"_202203A-001"},"menu":{"hasChildren":false},"tocID":"_202203A-001-d8884e14666","topics":[]},{"title":"Dec 2021: AT&amp;T 3G Sunset – Required Cellular Firmware Update for 110g ","shortdesc":"<p class=\"shortdesc\">AT&amp;T is turning off their 3G network on 2\/22\/22, which affects the Quectel modems         on the 110g <span class=\"ph\">Airwall Gateway<\/span>,         and any AV3200g\/u <span class=\"ph\">Airwall Gateways<\/span> installed before Dec 12, 2021. If you are operating one of these <span class=\"ph\">Airwall Gateways<\/span> using an         AT&amp;T cellular connection, you should install new cellular firmware on them before the         AT&amp;T shutoff date.<\/p>","href":"content\/topics\/adv_tn_202112_att_3g_sunset.html","attributes":{"data-id":"att_3g_sunset"},"menu":{"hasChildren":false},"tocID":"att_3g_sunset-d8884e14680","topics":[]},{"title":"Oct 2019: Upgrade <span class=\"ph\">Airwall Gateway<\/span> 100e or <span class=\"ph\">Airwall Gateway<\/span> 100g to 2.2 firmware","shortdesc":"<p class=\"shortdesc\">Upgrade <span class=\"ph\">Airwall Gateway<\/span> 100 to version         2.2 may result in a non-functional unit due to drive space issues.<\/p>","href":"content\/topics\/adv_tn_201910_001.html","attributes":{"data-id":"adv_tn_201910_001"},"menu":{"hasChildren":false},"tocID":"adv_tn_201910_001-d8884e14700","topics":[]},{"title":"Jan 2018: Spectre and Meltdown vulnerabilities","shortdesc":"<p class=\"shortdesc\">The Spectre and Meltdown vulnerabilities in modern processor architecture         optimizations, allow unprivileged local attackers to read arbitrary memory without         restrictions.<\/p>","href":"content\/topics\/adv_tn_201801_001.html","attributes":{"data-id":"adv_tn_201801_001"},"menu":{"hasChildren":false},"tocID":"adv_tn_201801_001-d8884e14720","topics":[]}]});